		console.log(`Debuffing all enemy Elementals Defense by ${deBuff}.`);
		for (let i = 0; i < enemy.elemental.length; i++) {
			enemy.elemental[i].defense = -deBuff;
			player.elemental[i].buffTime[stat.defense] = 1;
		}
	}
}

