		this._baseInteligence = 5;
		this._baseAgility = 17;

		// Secondary Stats
		this.health = this.maxHealth;
	}

	/*********************
	****** Getters *******
	*********************/

	/*********************
	****** Setters *******
	*********************/

	/*********************
	****** Methods *******
	*********************/

	calculateDmg(enemy) { // Armor Penetration
